import { Container, Row, Col, Breadcrumb, BreadcrumbItem } from "shards-react";
import Collapsible from "react-collapsible";

// Layout
import Layout from "../components/Layout";

const FAQ = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>

        <BreadcrumbItem active>Frequently Asked Questions</BreadcrumbItem>
      </Breadcrumb>
    </Container>
  </Layout>
);

export default FAQ;
